import React from 'react'
import Navigation from './nav'
class Header extends React.Component {
  render () {
    return (

      <div className='header' data-aos='nav-animation' data-aos-anchor-placement='top-top' data-aos-duration='500' data-aos-ease='ease-out-back' data-aos-delay='0'>
        <div className='logo'>mcg</div>
        <nav className='nav--desktop'><Navigation /></nav>

        <div className='header--mobile'>
          <nav className='nav--mobile' role='navigation'><Navigation /></nav>
        </div>

      </div>

    )
  }
}
export default Header
